import React, { useState } from "react";
const App = () => {
const [num,setNum]=useState(0);

const drama=()=>{
  setNum(num+1);
}
const drama2=()=>{
  setNum((prev)=>{
    if (prev===0) {
      return alert("bakchodi na chacha") ;
    }
    else{
        return prev-1;
    }
  });
}

return(
    <>
        <h1>hello</h1>
        <input placeholder="" >{num}</input>
        <button key='incre' onClick={drama}>incre</button>
        <button key='decre' onClick={drama2}>decre</button>
    </>
)
}
export default App;
